        const imprimirPdf = async(offset)=>{
                const config = {
                        method:'POST',
                        headers: {
                        'Content-Type': 'application/json'
                        },
                        body:JSON.stringify({limit:260, offset:offset})
                }
                const res = fetch("http://localhost:4000/livros", config).then(dados=> dados.json()).then( async response=>{
                        var num = 0;
                        var ar = 1;
                        var pdf;
                        var numTodos = 0
                        var titulo;
                        for (const key in response) {
                                num++
                                if(num == 1){
                                        numTodos++;
                                        pdf = await new jsPDF('portrait', 'pt', 'a4');         
                                        pdf.addImage(imgBase, 'JPEG', 0,0,590,830)
                                        pdf.setTextColor('#242424')
                                } 
                                if(response[key].titulo.length > 70){
                                        titulo = response[key].titulo;
                                        titulo = titulo.substr(0, 70);
                                        titulo += '...';
                                        response[key].titulo = titulo
                                }
                                pdf.setFontSize(13)
                                pdf.text(yLocal, xTodos[num], response[key].estante +''+ response[key].prateleira);
                                pdf.text(yTombo, xTodos[num], response[key].tombo);
                                pdf.setFontSize(9)
                                pdf.text(yTitulo, xTodos[num], response[key].titulo);
                                if(num == 26 || response[key].tombo == '0366'){
                                        await pdf.save("patrimonio"+ar+ ".pdf");
                                        ar++;
                                        num = 0;  
                                }
                        }
                })

        }
        
